import React from 'react';
import CachipunContainer from './Components/CachipunContainer';
import './style.css';

export default function CachipunEvaluation(props) {
  return (
    <div>
        {props.gameCounter <= 5 && <CachipunContainer />}
        {props.gameCounter > 5 && <h2>Se acabo el juego</h2>}
    </div>
  );
}
